INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1001, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1.4, 1, 2, "春咲 ひより", 0, 0, 0, 1, 0, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1002, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1.4, 1, 2, "草野 優衣", 0, 0, 0, 1, 0, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1003, 1, "少しは磨かれると思いますよ。", 0, 1.4, 1, 2, "士条 怜", 0, 0, 0, 1, 0, "キミに必要な集中力と感性が", "フェンシングを始めてみては？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1004, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1.5, 1, 2, "穂高 みそぎ", 0, 0, 0, 1, 0, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1006, 1, "私といっしょに…\nいかない？", 0, 1.4, 1, 2, "風宮 あかり", 0, 0, 0, 1, 0, "ねぇ…", "風宮あかりです");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1007, 1, "食べ物の恨みは怖いのー", 0, 1.5, 1, 2, "出雲 宮子", 0, 0, 0, 1, 0, "プリンたべたいのー", "出雲宮子なのー");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1008, 1, "いいよ。\n見られることは運命さ…", 0, 1.4, 1, 2, "虹村 雪", 0, 0, 0, 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1009, 1, "人呼んで「疾風の冥姫」!!", 0, 1.4, 1, 2, "柊杏奈", 0, 0, 0, 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1010, 1, "ほんまおおきにやわ～♪", 0, 1.5, 1, 2, "姫宮 真歩", 0, 0, 0, 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1011, 1, "ここで会ったが\n100年目～！", 0, 1.4, 1, 2, "衣之咲 璃乃", 0, 0, 0, 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1012, 1, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1.4, 1, 2, "柏崎 初音", 0, 0, 0, 1, 0, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1016, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1.4, 1, 2, "美波 鈴奈", 0, 0, 0, 1, 0, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1017, 1, "でも、沖縄もとってもいいとこさー", 0, 1.4, 1, 2, "喜屋武 香織", 0, 0, 0, 1, 0, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1018, 1, "イオちゃんって呼んでね。", 0, 1.4, 1, 2, "支倉 伊緒", 0, 0, 0, 1, 0, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1020, 1, "ミミをおいてかないでぇ～", 0, 1.5, 1, 2, "茜 ミミ", 0, 0, 0, 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1021, 1, "ふぇぇぇぇぇん……", 0, 1.5, 1, 2, "栗林 くるみ", 0, 0, 0, 1, 0, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1022, 1, "なんてありがとうございます！", 0, 1.4, 1, 2, "風宮 より", 0, 0, 0, 1, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1023, 1, "私こっち行きたいー\nね、早く早くー", 0, 1.5, 1, 2, "北条 綾音", 0, 0, 0, 1, 0, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1025, 1, "これて何か違う…\nあああすみません！", 0, 1.4, 1, 2, "天野 すずめ", 0, 0, 0, 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1027, 1, "離しませんわ………\n絶対に…!!", 0, 1.4, 1, 2, "倉石 恵理子", 0, 0, 0, 1, 0, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1028, 1, "…そうでしょ？？", 0, 1.4, 1, 2, "佐々木 咲恋", 0, 0, 0, 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1029, 1, "あはは、\n私もまだまだだなぁ～", 0, 1.4, 1, 2, "桜井 望", 0, 0, 0, 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1030, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1.4, 1, 2, "ニノン・ジュベール", 0, 0, 0, 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1031, 1, "おかしいですね……", 0, 1.4, 1, 2, "上喜 しのぶ", 0, 0, 0, 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1033, 1, "そう、\nオラのボケに突っ込める相方が…！", 0, 1.5, 1, 2, "野戸まひる", 0, 0, 0, 1, 0, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1034, 1, "ちょ\nちょっと一杯飲んできます…！", 0, 1.4, 1, 2, "綾瀬 ゆかり", 0, 0, 0, 1, 0, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1036, 1, "これ以上お話しすることは…\nないです！", 0, 1.5, 1, 2, "氷川 鏡華", 0, 0, 0, 1, 0, "知らない人とは話しちゃいけないので", "氷川鏡華…です");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1038, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1.4, 1, 2, "柏崎 栞", 0, 0, 0, 1, 0, "……あ、アラーム。", "柏崎…栞です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1040, 1, "野に咲く花が、\n唯一の話相手です。", 0, 1.4, 1, 2, "双葉 碧", 0, 0, 0, 1, 0, "私、一人も友達がいなくて……", "ふ、双葉碧です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1042, 1, "そう思っています。", 0, 1.4, 1, 2, "三角 千歌", 0, 0, 0, 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1043, 1, "う、疑ってすまなかったな…", 0, 1.4, 1, 2, "安芸 真琴", 0, 0, 0, 1, 0, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1044, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1.4, 1, 2, "イリヤ・オーンスタイン", 0, 0, 0, 1, 0, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1045, 1, "ｌク、クウカに何かご用ですか!?", 0, 1.4, 1, 2, "遠見 空花", 0, 0, 0, 1, 0, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1046, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1.4, 1, 2, "宮坂たまき", 0, 0, 0, 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1048, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1.4, 1, 2, "大神 美冬", 0, 0, 0, 1, 0, "それでは早速クエストに…", "大神美冬よ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1049, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1.4, 1, 2, "星野静流", 0, 0, 0, 1, 0, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1050, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1.5, 1, 2, "玉泉美咲", 0, 0, 0, 1, 0, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1052, 1, "？？？？", 0, 1.4, 1, 2, "リマ", 0, 0, 0, 1, 0, "？？？？", "？？？");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1053, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, 1, 2, "モニカ・ヴァイスヴィント", 0, 0, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1058, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, 1, 2, "ペコリーヌ", 0, 0, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1059, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, 1, 2, "コッコロ", 0, 0, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES (1060, 1, "そ、そこまでいうなら\nもらってやる", 0, 1.5, 1, 2, "キャル", 0, 0, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。");
